import React from 'react';
import company1 from '../assets/OpenAI.png';
import company2 from '../assets/Meta.png';
import company3 from '../assets/nvidia.png';
import company4 from '../assets/Hugging-Face.png';
import company5 from '../assets/langchain.png';

const TrustedBy = () => {
  return (
    <section className="bg-gray-100 py-8">
      <div className="container mx-auto px-6 text-center">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">Trusted By</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
          <img src={company1} alt="Company 1" className="h-12 mx-auto" />
          <img src={company2} alt="Company 2" className="h-12 mx-auto" />
          <img src={company3} alt="Company 3" className="h-12 mx-auto" />
          <img src={company4} alt="Company 4" className="h-12 mx-auto" />
        </div>
      </div>
    </section>
  );
};

export default TrustedBy;
